pragma solidity ^0.5.0;
import './MedicalHistory.sol';
import './Agent.sol';

contract Patient is Agent{

    MedicalHistory public mHistory;

    constructor(address ma, string memory nm,string memory ui, string memory di,string memory pass, string memory tp, string memory pbKey) Agent(ma,nm,ui,di,pass,tp,pbKey) public{
        mHistory = new MedicalHistory({mh:""});
        myAddress = ma;
        name = nm;
        uid = ui;
        did = di;
        password = pass;
        aType = tp;
        publicKey = pbKey;
    }

}
